    "valley-city-wetlands-management-district-annual-narrative-report-calendar-year-1972",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Valley City Wetland
    Management District during the 1972 calendar year. The report begins by giving a
    description of the area, status of the acquisition program, weather conditions,
    and habitat conditions during the year. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors, rare and
    endangered species, fish, and reptiles- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, collections
    and receipts, vegetation control, and prescribed fire. Resource management is described;
    topics include grazing and fur harvest. A progress report on field investigations
    and applied research is also provided. The public relations section discusses recreational
    uses, Refuge visitors, Refuge participation, hunting, violations, and safety. Items
    of interest, N-R forms, and photographs are attached.",nt"license_title": "License
